import React from "react";
import {Link} from "react-router-dom";

const NavigationSidebar = ({active = 'explore'}) => {
  return(
      <>
            <div className="list-group">
                <Link className="list-group-item" href="/"><i className="fab fa-twitter"></i></Link>

                <a href="home.html" className={`list-group-item list-group-item-action ${active === 'home' ? 'active' : ""}`}><i className="fa fa-house-user"></i><span className="d-none d-sm d-xl-inline-block">Home</span></a>
                <a href="#" className={`list-group-item list-group-item-action ${active === 'explorer' ? 'active' : ""}`}><i className="fa fa-hashtag"></i><span className="d-none d-sm d-xl-inline-block"> Explore</span></a>
                <a href="notification.html" className="list-group-item list-group-item-action"><i className="fa fa-bell"></i><span className="d-none d-sm  d-xl-inline-block"> Notification</span></a>
                <a href="message.html" className="list-group-item list-group-item-action"><i className="fa fa-envelope"></i><span className="d-none d-sm d-xl-inline-block"> Message</span></a>
                <a href="bookmarks.html" className="list-group-item list-group-item-action"><i className="fa fa-bookmark"></i><span className="d-none d-sm d-xl-inline-block"> Bookmarks</span></a>
                <a href="lists.html" className="list-group-item list-group-item-action"><i className="fa fa-list"></i><span className="d-none d-sm  d-xl-inline-block"> List</span></a>
                <a href="profile.html"className="list-group-item list-group-item-action"><i className="fa fa-user"></i><span className="d-none d-sm  d-xl-inline-block"> Profile</span></a>
                <a href="#"className="list-group-item list-group-item-action"><i className="fa fa-caret-down"></i><span className="d-none d-sm d-xl-inline-block"> More</span></a>
            </div>
            <div className="d-grid mt-2">
                <a href="tweet.html"
                   className="btn btn-primary btn-block rounded-pill">
                    Tweet</a>
            </div>
      </>
    );
}
export default NavigationSidebar;
